/* 
Bncr Spy
特性
1、OOP纯异步监控
从收到消息的那一刻开始就是异步操作，意味着可以高收信。
经过多个线报群0点测试，内存cpu上升微乎其微，几乎秒响应，漏消息，漏变量，错误判断新旧变量几乎不存在

2、多容器 
单容器单线程处理，不会因为其中一个容器没执行完队列阻塞其他容器(超授可用)

3、扩展性
收到不是变量格式消息后可调用外部模块来处理消息，转换为变量后调用内部监听器来继续处理，其模块完全diy(非超授不会调用外部模块)
收到变量后可调用外部模块来判断变量是否有效，有效则加入队列，其模块完全diy(非超授不会调用外部模块)

4、定时任务
可手动创建一个定时立即执行任务
根据此特性 可通过外部模块判断活动是否开始，没开始读取开始时间，定时到点强制运行该线报！其模块完全diy (非超授不会调用外部模块)

5、插队功能
通过 插队线报 命令可以将该线报强制加入下一个运行队列，如果队列其他位置有该任务，则会删除列队(非超授不可用)

6、立即执行功能
通过 立即执行 命令 触发的线报会立即终止任务 并执行触发的新线报(非超授不可用)

7、支持多变量监听、多变量转换
A>B
C>D


命令说明:
spy定时任务 
创建一个一次性定时强制执行的线报
例:spy定时任务 0 0 9 20 3 * export M_WX_POINT_DRAW_URL="123123"
此定时会在3月20日09点00分00秒 触发,cron表达式一定是6位数(精确到秒)

spy立即执行
立即执行该线报,不会检测是否运行过,且强制中断正在运行中的任务执行该线报

spy插队
将线报强制插入列头,下一个线报必定运行该线报

spy状态|详细状态|清空列队|所有定时任务|清空定时任务
都是字面意思

*/

